describe('Field updation inside the positioned table validation', () => {
  let editor: DocumentEditor = undefined;
  let dialog: PageSetupDialog;
  beforeAll(() => {
      document.body.innerHTML = '';
      let ele: HTMLElement = createElement('div', { id: 'container' });
      document.body.appendChild(ele);
      DocumentEditor.Inject(Selection, Editor);
      editor = new DocumentEditor({ isReadOnly: false, enableSelection: true, enableEditor: true, enableWordExport: true, enableSfdtExport: true });
      (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
      DocumentEditor.Inject(Selection, Editor, SfdtExport);
      editor = new DocumentEditor({ isReadOnly: false, enableSelection: true, enableEditor: true, enableWordExport: true, enableSfdtExport: true });
      (editor.documentHelper as any).contdainerCanvasIn = TestHelper.containerCanvas;
      (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
      (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
      (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
      editor.appendTo('#container');
  });
  afterAll((done) => {
      editor.destroy();
      document.body.removeChild(document.getElementById('container'));
      editor = undefined;
      document.body.innerHTML = '';
      setTimeout(() => {
          done();
      }, 1000);
  });
  it('Field updation inside the positioned table validation', () => {
    editor.open(JSON.stringify(fieldInsideTable));
    editor.selection.select('0;93;0;0;0;15','0;93;0;0;0;15');
   editor.editor.insertText('check');
    editor.updateFields();
    expect(editor.documentHelper.pages[7].bodyWidgets[0].floatingElements[7].x).not.toBe(editor.documentHelper.pages[7].bodyWidgets[0].floatingElements[8].x);
    expect(editor.documentHelper.pages[7].bodyWidgets[0].floatingElements[7].y).not.toBe(editor.documentHelper.pages[7].bodyWidgets[0].floatingElements[8].y);
  });
});